Друзья, всем привет. 
Лето уже на исходе, и я уверена, что есть люди, которые не успели сполна насладиться теплыми деньками или не все успели сделать. Но, я к вам с хорошими новостями, у нас еще есть возможность наверстать упущенное. 
Ловите мой чек-лист со 📃списком приятных дел, которые необходимо успеть сделать до окончаия летнего сезона. Может кому-то из вас пригодится.

Итак: 
1. Испечь 🍰 пирог из домашних яблок (как раз сегодня этим и займусь) ;

2. Отправиться в маленькое путешествие, пусть даже и в соседний лес и устроить на сказочной поляне пикник с бутербродами и травяным 🍵 чаем или сосисками, приготовленными на углях, кому что нравится ;

3. Почитать любимую 📙 книгу в 🏞 парке здесь вы совмещаете приятное с полезным. Наполняете свой мозг знаниями и кислородом, а душу вдохновением и приятными эмоциями;

4. Посмотреть свежую, как морской бриз комедию или сделать выбор в пользу старого фильма, который всегда дарит положительные эмоции. Важно! Атмосфера фильма обязательно должна быть наполнена летом, ☀ солнцем и 🏖 пляжем;

5. Сделать натуральную маску для лица из свежих овощей или фруктов, а из остальной части продуктов сделать полезный для вашего организма смузи. Тем самым, вы напитаете себя не только снаружи, но изнутри. Сейчас как раз самое время;

6. Устроить разгрузочный день от интернета и социальных сетей, вы удивитесь, сколько свободного времени вдруг появится на дела, которые раньше вы не успевали сделать;

7. Посетить кинотеатр под открытым небом, если у вас такого нет, то смело включайте сюда 4 пункт, берите ноут , найдите укромное местечко на свежем воздухе и устройте просмотр, воспоминания о котором обязательно согреют вас морозной зимой;

Вот, пожалуй, и все. Буду рада, если поделитесь в комментариях своими обязательными пунктиками. Мне будет очень интересно:) 😘 #summer #чеклист #список #времяторописьмедленней #читай #happy #wonderful #ilovemylife #lifestyle #diary #flowers
